export function changeSportId(newID){
    return {type: "CHANGE_SPORT_ID", payload: {currentSportId: newID}}
}

export function changeViewStatus(vStatus){
    return {type: "CHANGE_SPORT_ID", payload: {viewStatus: vStatus}}
}
